import os, sys, secrets, string
import click
from time import sleep
# Settings
class Settings():
    def __init__(self, tries=6, word_length=5) -> None:
        self.tries = tries
        self.word_length = word_length

# Stats
class Stats():
        def __init__(self, win: int = 0, lose: int = 0, rounds: int = 0, guessed_words: int = 0) -> None:
            self.win = win
            self.lose = lose
            self.rounds = rounds
            self.guessed_words = guessed_words

# Main
def main():
    settings = Settings()
    stats = Stats()
    game(settings, stats)

# Game Loop
def game(settings, stats):
    clear_console()
    # Game Title
    print("Wordle - English")
    print(click.style("/help | /stats | /settings | /restart | /quit", fg="bright_black"))
    print(click.style(f"\nRound {stats.rounds + 1}\n", underline=True))
    round_start(settings, stats)

# Round Start
def round_start(settings, stats):
    wordle = get_word().lower()
    print(wordle)
    guessed_words = []
    game_info = False
    while True:
        menu_lines = 1
        # Print Characters
        if render_characters(guessed_words, wordle):
            menu_lines += 1
        # # Print guessed words
        if render_guessed_words(guessed_words, wordle):
            for x in guessed_words:
                menu_lines += 1
        # Print Info
        if game_info:
            render_game_info(game_info)
            menu_lines += 1

        # validate win
        if wordle.lower() in guessed_words:
            stats.rounds += 1
            stats.win += 1
            print(click.style("\n   !! Won !!", fg="green"))
            try:
                if input("\nContinue? y/N ").strip().lower() in ["n", "no"]:
                    sys.exit()
                else:
                    clear_console()                    
                    game(settings, stats)
            except (KeyboardInterrupt,EOFError):
                sys.exit()
        # validate lose
        elif len(guessed_words) == 6:
            stats.rounds += 1
            stats.lose += 1
            try:
                print(click.style("\n  !! Lost !!", fg="yellow"))
                print(f"{click.style("Wordle: ", fg="bright_black")} {wordle.upper()}")
                if input("\nContinue? y/N ").strip().lower() in ["n", "no"]:
                    sys.exit()
                else:
                    clear_console()                    
                    game(settings, stats)
            except (KeyboardInterrupt,EOFError):
                sys.exit()

        # Get input
        user_input = get_user_input(settings, stats, guessed_words)

        # Game msg
        game_info = validate_guess_msg(user_input)
        # Validate 
        if validate_guess(user_input):
            game_info = False
            stats.guessed_words += 1
            guessed_words.append(user_input.lower())
            clear_line(menu_lines)
        else:
            clear_line(menu_lines)
            continue

# Render game info msg
def render_game_info(info=None):
    print(click.style(f"{info}", fg="bright_black"))

# Render characters
def render_characters(guessed_words, wordle):
        chars = []
        chars_colored = []
        for word in guessed_words:
            for x,y in zip(word, wordle):
                if x not in chars:
                    chars.append(x)
                    if x in wordle:
                        chars_colored.append(click.style(x.upper(), fg="yellow"))
                    else:
                        chars_colored.append(x.upper())
        
        chars_str = ""
        for char in chars_colored:
            chars_str += char

        print("Chars:", chars_str)

        return True

# Render guessed words
def render_guessed_words(guessed_words, wordle):
    wordle = wordle.lower()
    if len(guessed_words) > 0:
        for word, count in zip(guessed_words, range(len(guessed_words))):
            characters_styled = []
            characters = []
            for char_x, char_y in zip(word, wordle):
                if char_x == char_y:
                    characters_styled.append(click.style(char_x.upper(), fg="green"))
                # Not 100% correct
                elif char_x in wordle and not char_x in characters:
                    characters_styled.append(click.style(char_x.upper(), fg="yellow"))
                else:
                    characters_styled.append(char_x.upper())
                characters.append(char_x)
            word = ""
            for x in characters_styled:
                word += x
            print(f"    {count+1}.", word)

        return True
    else:
        return False
    
# Get random word
def get_word():
    return secrets.choice(word_list)

# Validate guess
def validate_guess(user_input):
    if len(user_input) > 5:
        return False
    elif len(user_input) < 2:
        return False
    elif not user_input in word_list_valid:
        return False
    else:
        # More validation
        for x in user_input:
            if x not in string.ascii_letters:
                return False
        # Validation Done
        return True

def validate_guess_msg(user_input):
    msg = ""
    invalid_char = ""
    for x in user_input:
        if x not in string.ascii_letters:
            invalid_char += x
            msg = f"includes invalid characters. {click.style(f"'{click.style(invalid_char, fg="yellow")}'", fg="white")}"
    if len(user_input) == 0:
        return False
    elif len(user_input) > 5:
        msg = "to long"
    elif len(user_input) < 2:
        msg = "to short"
    elif not user_input in word_list_valid:
        msg = "not in word-list"

    start = click.style("Guess", fg="bright_black")
    word = click.style(f"'{user_input.upper()}'", fg="white")
    end = click.style(msg, fg="bright_black")
    msg = start + " " + word + " " + end
    return msg

# Validate Win
def validate_win(user_input, wordle):
    wordle = wordle.lower().strip()
    guess = user_input.lower().strip()
    if guess == wordle:
        return True
    else:
        return False

# User input
def get_user_input(settings, stats, guessed_words):
    try:
        print("Guess: ", end="")
        backspace = "\b" * settings.word_length
        user_input = input(f"_____{backspace}").lower().strip()
        if user_input in ["/h", "/help"]:
            lines =  print_gamerules(settings)
            click.pause("Continue? ")
            clear_line(lines + 1)
            return ""
        elif user_input in ["/s", "/stats"]:
            lines = print_stats(stats)
            click.pause("Continue? ")
            clear_line(lines + 1)
            return ""
        elif user_input in ["/set", "/settings"]:
            lines = print_settings(settings)
            click.pause("Continue? ")
            clear_line(lines + 1)
            return ""
        elif user_input in ["/r", "/restart"]:
            main()
        elif user_input in ["/q", "/quit"]:
            sys.exit()
        else:
            return user_input
    except (KeyboardInterrupt,EOFError):
        print("\nTerminated by user")
        sys.exit()

# Utility
def clear_line(n: int = 1):
    for _ in range(n):
        click.echo("\033[A\033[0J\r", nl=False)

def clear_console():
    if os.name == "nt":
        os.system("cls")
    else:
        os.system("clear")

# Print functions
def print_gamerules(settings):
    msg = [
        "",
        f"{click.style("Gamerules:", underline=True, fg="bright_black", bold=True)}",
        f"  Guess the Wordle in {settings.tries} tries",
        "  Each guess must be a valid 5-letter word",
        "  All letters count uppercase, even when typed lowercase",
        "  Color of the chars will change to show how close you are",
        f"{click.style("Commands:", underline=True, fg="bright_black", bold=True)}",
        f"  {click.style(f"/h | /help       - Show help", fg="white")}",
        f"  {click.style(f"/s | /stats      - Show Stats", fg="bright_black")}",
        f"  {click.style(f"/set | /settings - Show Settings", fg="white")}",
        f"  {click.style(f"/r | /restart    - Restart game", fg="bright_black")}",
        f"  {click.style(f"/q | /quit       - Quit game", fg="white")}",
        ""
    ]

    for x in msg:
        print(x)
    return len(msg)

def print_stats(stats):
    msg = [
        "",
        f"{click.style("Stats:", fg="bright_black", underline=True)}",
        f"Win {click.style(stats.win, fg="bright_black")} | Lose {click.style(stats.lose, fg="bright_black")} | Rounds {click.style(stats.rounds, fg="bright_black")}",
        f"Guesses: {click.style(stats.guessed_words, fg="bright_black")}",
        ""
    ]
    for x in msg:
        print(x)
    return len(msg)

def print_settings(settings):
    msg = [
        "",
        f"{click.style("Settings:", fg="bright_black", underline=True)}",
        f"  If you change any settings, the game will reset",
        "",
        f"{click.style("Options:", fg="bright_black", underline=True)}",
        f"  tries{click.style("=", fg="bright_black")}int, word_length{click.style("=", fg="bright_black")}int",
        "",
        f"{click.style("Command usage:", fg="bright_black", underline=True)}",
        f"  /settings tries{click.style("=", fg="bright_black")}10",
        f"  /set word_length{click.style("=", fg="bright_black")}5",
        ""
    ]
    for x in msg:
        print(x)
    return len(msg)

